        alignItems: "Right",
        height: "100vh",
      }}
    >
      <h1>Platvoet Development in the Netherlands</h1>
      email:
      <image src="./assets/platvoetdevolopment.png" width="500" height="100" />
    </div>
  );
};

export default About;
